      &quot;Amount&quot;: {&quot;$numberDecimal&quot;: &quot;6.17&quot;}
    }
  ]
}
</code></pre>
<p>Is there a simple way to find documents where the startdate has overlapped with previously startdate, enddate?
The startdate can not be before previous end dates within the array
