How to use aggregation to generate yearly sales report?<p>Schema:</p>
<pre><code>const orderSchema = mongoose.Schema(
{

  orderStatus: {
         type: String,
         enum: [&quot;pending&quot;, &quot;preparing&quot;, &quot;completed&quot;, &quot;declined&quot;],
         default: &quot;pending&quot;,
  },
   products: [
          {
            product: {
              productId: {
                type: mongoose.Schema.Types.ObjectId,
                ref: &quot;Product&quot;,
              },
              productName: String,
              productPrice: Number,
              categoryName: String,
            },
            quantity: {
              type: Number,
              required: true,
            }

          },
   ],
   totalPrice: { type: Number },
   acceptDeclineTime: {
      type: Date,
      default: Date.now,
   },
}
);
</code></pre>
<p>I want a yearly sales report with number of orders accepted and declined, with total price for each.</p>
<p>I tried:</p>
<pre><code>orderSchema.aggregate(
    [

     {
        $unwind: {
          path: &quot;$products&quot;,
        },
      },

     {

     $group: {
          _id: { $year: { date: &quot;$acceptDeclineTime&quot;, timezone: &quot;+03:00&quot; } },
              totalCompletedPrice: {
                $sum: {
                  $cond: [{ $eq: [&quot;$orderStatus&quot;, &quot;completed&quot;] }, &quot;$totalPrice&quot;, 0],
                },
              },
              totalDeclinedPrice: {
                $sum: {
                  $cond: [{ $eq: [&quot;$orderStatus&quot;, &quot;declined&quot;] }, &quot;$totalPrice&quot;, 0],
                },
              },
              totalItems: {
                $sum: &quot;$products.quantity&quot;,
              },
              completedSales: {
                $sum: {
                  $cond: [{ $eq: [&quot;$orderStatus&quot;, &quot;completed&quot;] }, &quot;$products.quantity&quot;, 0],
                },
              },
              cancelledSales: {
                $sum: {
                  $cond: [{ $eq: [&quot;$orderStatus&quot;, &quot;declined&quot;] }, &quot;$products.quantity&quot;, 0],
                },
              },

            },
          },

]);
</code></pre>
<p>But the price calculation is wrong as the <code>$unwind</code> stage duplicates total price of products which will be problematic on the <code>$sum</code> operation.</p>

