{ &quot;level&quot; : &quot;4&quot;, &quot;x&quot; : 6.3, &quot;y&quot; : 0.5 }  
</code></pre>
<p>I'd like to calculate the $max (and $min) for each $x and $y within (groupBy) each $level and return those results as new fields into the original documents for the next stage in an aggregation pipeline.</p>
<p>Desired output:</p>
