</code></pre>
<p>I managed to set up the first part of the aggregation pipeline:</p>
<pre><code>.aggregate([
          {
            $group: {
              _id: '$level',
              min_x: { $min: '$x' },
              max_x: { $max: '$x' },
              min_y: { $min: '$y' },
              max_y: { $max: '$y' }
            },
          },
        ]
...
</code></pre>
<p>And this gave me correct results for the grouping part, grouped by the $level, however I am not sure how to merge these results back into the documents for each $level as shown above.</p>

