MongoDB Case insensitive index not working as expected<p>I have the following query which matches 2 collections using common fields, but there was a problem, the comparison was not insensitive, therefore I didn't get full match.
I then tried to make it insensitive..</p>
<p>Here's the query I was using:</p>
<pre><code>cursor= db.csv_import.aggregate([
 {
     $lookup: {
  from: 'EN',
  let: {pn:'$part_no',vendor:'$vendor_standard'},
  pipeline: [{
      $match: {
          $expr: {
              $and: [{$eq: [&quot;$$pn&quot;,&quot;$ICECAT-interface.Product.@Prod_id&quot;]}],{$eq: [&quot;$$vendor&quot;,&quot;$ICECAT-interface.Product.Supplier.@Name&quot;]}]
          }
      }
  }],
  as: 'part_number_info'
     }
 }, { $match: {&quot;part_number_info.0&quot;: {$exists: true}}
 }, { $project: {&quot;part_no&quot;: 1,&quot;part_number_info.ICECAT-interface.Product.@ID&quot;: 1, &quot;part_number_info.ICECAT-interface.Product.Supplier.@Name&quot;: 1, &quot;_id&quot;:0}}
 ]).pretty();
</code></pre>
<p>I've read about insensitive here:
<a href="https://www.mongodb.com/docs/manual/core/index-case-insensitive/" rel="nofollow noreferrer">https://www.mongodb.com/docs/manual/core/index-case-insensitive/</a></p>
<p>so I did create 2 index for vendor and product part number on the 2 collections as follow (example for part number)</p>
<pre><code>db.csv_import.createIndex(
    {'part_no': 1},{name: &quot;part_no_unsensitive_idx&quot;, collation: {locale: &quot;en&quot;,strength:2})

  db.EN.createIndex(
    {'ICECAT-interface.Product.@Prod_id': 1},{name: &quot;product_unsensitive_idx&quot;, collation: {locale: &quot;en&quot;,strength:2})
</code></pre>
<p>and I tried this:</p>
<pre><code>cursor= db.csv_import.aggregate([
 {
     $lookup: {
  from: 'EN',
  let: {pn:'$part_no',vendor:'$vendor_standard'},
  pipeline: [{
      $match: {
          $expr: {
              $and: [{$eq: [&quot;$$pn&quot;,&quot;$ICECAT-interface.Product.@Prod_id&quot;]},{$eq: [&quot;$$vendor&quot;,&quot;$ICECAT-interface.Product.Supplier.@Name&quot;]}]
          }
      }
  }],
  as: 'part_number_info'
     }
 }, { $match: {&quot;part_number_info.0&quot;: {$exists: true}}
 }, { $project: {&quot;part_no&quot;: 1,&quot;part_number_info.ICECAT-interface.Product.@ID&quot;: 1, &quot;part_number_info.ICECAT-interface.Product.Supplier.@Name&quot;: 1, &quot;_id&quot;:0}}
 ]).collation( { locale: 'en', strength: 2 }).pretty();
</code></pre>
<p>However, the execution time went from milliseconds to long minutes (more than 10 minutes). Apparently it is not using the index whatsoever, was there an issue with the way I created the index or am I missing something else here?</p>
<p><strong>EDIT</strong></p>
<p>I changed it to this as suggested (collation after pipeline) and although it improved (took half of the time) still takes an hour versus without collation which takes a few seconds:</p>
<pre><code>use Icecat
db.csv_import.aggregate([
 {
     $lookup: {
  from: 'EN',
  let: {pn:'$part_no',vendor:'$vendor_standard'},
  pipeline: [{
      $match: {
          $expr: {
              $and: [{$eq: [&quot;$$pn&quot;,&quot;$ICECAT-interface.Product.@Prod_id&quot;]},{$eq: [&quot;$$vendor&quot;,&quot;$ICECAT-interface.Product.Supplier.@Name&quot;]}]
          }
      }
  }],
  as: 'part_number_info'
     }
 }, { $match: {&quot;part_number_info.0&quot;: {$exists: true}}
 }, { $project: {&quot;part_no&quot;: 1,&quot;part_number_info.ICECAT-interface.Product.@ID&quot;: 1, &quot;part_number_info.ICECAT-interface.Product.Supplier.@Name&quot;: 1, &quot;_id&quot;:0}
 }
 ],
 {collation: { locale: 'en', strength: 2 }
 ).pretty();
</code></pre>
<p><strong>EDIT 2</strong></p>
<p>Output of explain:</p>
<pre><code>{
  &quot;explainVersion&quot;: &quot;1&quot;,
  &quot;stages&quot;: [
    {
      &quot;$cursor&quot;: {
        &quot;queryPlanner&quot;: {
