How can I find a value from an array using another object value in MongoDB group aggregation?<p>I have a collection where I want to find one data based on another object data:</p>
<pre class="lang-js prettyprint-override"><code>const data = [
{  _id :0, name:&quot;jane&quot;,  joined : ISODate(&quot;2011-03-02&quot;),  likes : 30, dislikes: 9},
{  _id :1, name: &quot;joe&quot;,  joined : ISODate(&quot;2012-07-02&quot;),  likes : 40, dislikes: 07},
{  _id : 2, name:&quot;Ant&quot;,  joined : ISODate(&quot;2012-07-02&quot;),  likes : 60, dislikes: 02}
]
</code></pre>
<p>From here I want to get the name who got most likes and I want to get the name who got maximum dislikes.</p>
<p>My code is like this:</p>
<pre class="lang-js prettyprint-override"><code>const parcel = await regionModel.aggregate([
  {
    $match: {
      &quot;likes&quot;: { $gt: 0 },
    }
  },
  {
    $group: {
      likes: {
        $max: &quot;$likes&quot;
      },
      dislikes: {
        $max: &quot;$dislikes&quot;
      }
    }
  }
])
</code></pre>
<p>In this code, I can get the maximum <code>likes</code> value and maximum <code>likes</code>, but how can I get the <code>name</code> or whole object based on the max <code>likes</code> and max <code>dislikes</code>?</p>
<p><strong>Required Output:</strong></p>
<pre><code>likes: 60
MostLikedName: &quot;Ant&quot; ---OR--- {  _id : 2, name:&quot;Ant&quot;,  joined : ISODate(&quot;2012-07-02&quot;),  likes : 60, dislikes: 02}
dislikes. 09
mostDislikedName: &quot;Jane&quot; ---OR--- {  _id :0, name:&quot;jane&quot;,  joined : ISODate(&quot;2011-03-02&quot;),  likes : 30, dislikes: 9}
</code></pre>
<p>I tried to sort the the document but I can sort the document based on dislike or like. Also I was wondering if I can use <code>$cond</code> here.</p>

